                </TableCell>
                <TableCell>{row?.email}</TableCell>
                <TableCell>{row?.location.country}</TableCell>
                <TableCell>{row?.login.username}</TableCell>
                <TableCell>{row?.registered.age}</TableCell>
              </TableRow>
            ))
          )}
        </TableBody>
      </Table>
    </TableContainer>
  );
}
